description:
Моят А1 твоят портал към дигиталните услуги на А1

Приложението Моят А1 с нов дизайн, функционалности и повече възможности за управление на мобилни, интернет и ТВ услуги от А1 – лесно, бързо, сигурно:
•  Следиш и плащаш месечните си фактури;
•  Проверяваш текущата си сметка и оставащи MB и минути;
•  Активираш роуминг на най-подходящата тарифа според държавата, в която ще пътуваш;
•  Преглеждаш и подписваш договори онлайн;
•  Следиш статус на заявки за инсталация на нова фиксирана услуга и технически проблем;
•  Правиш сам настройки на Wi-Fi мрежата си;
•  Добавяш допълнителни пакети и услуги в плана си;
•  Управляваш кредитния си лимит;
•  Получаваш персонални оферти;
•  И още много други възможности специално за теб в Моят А1.

Моят А1 е безплатно мобилно приложение за клиенти с устройства iOS (версия 13.0 или по-висока).  Може да го използваш през мобилна мрежа и Wi-Fi през смартфон и таблет. Налично е за клиенти на А1 България на абонаментен, предплатен или бизнес план. Работи с автоматично разпознаване на мобилния номер, през който използваш приложението или чрез регистрация.

За да се възползваш от всички функционалности за управление и да имаш видимост и достъп до всички услуги, които използваш от А1, следва да се регистрираш с титулярен профил.

Погрижили сме се да осигурим достъп и на ползвателите на конкретна услуга, но с ограничени права за управление на същата.

В случай, че продължиш с инсталирането или обновяването на приложението се съгласяваш с Общите условия.

Mобилното приложение My Vivacom – е поратал, който осигурява удобно, бързо и приятно потребителското усещане.

Модрен дизайн, по-лесна навигация, подобрена производителност – създадено с мисъл към клиента.


Мобилно приложение My Vivacom е с модерен и изчистен интерфейс, който прави използването на приложението интуитивно и приятно и улеснено управление на мобилни, интернет и ТВ услуги:

→ Всичките услуги вече са подредени по договор и фактура – така лесно намирате това, което търсите. Виждате последната фактура веднага, с директен достъп до страницата за плащане.

→ Управление на услугите спред нуждите – активация на роуминг и допълнителни пакети, настройки на EON профил, устройства, оборудване и интернет;

→ По-бърз достъп до важна информация, като мобилно потребление и други основни секции;

→ Персонализирани оферти изцяло онлайн;

→ Разширена секция с поддръжка за още по-бърза помощ;

→ Оценяваме вашата обратна връзка! Споделете впечатления и предложения, за да направим дигиталното изживяване с Vivacom още по-добро.

Мобилното приложение My Vivacom е достъпно за всички клиенти на Виваком България – с абонаментен, предплатен или бизнес план. Може да се използва с мобилен номер или чрез регистрация с email адрес.

Благодарим ви за доверието!

Екипът на Vivacom
